import React, {Component} from 'react';
import Todo from "../Todo/Todo";
import './LIst.css'
class List extends Component {
    render() {
        return (
            <ul className="todo-main">
                <Todo/>
                <Todo/>
            </ul>
        );
    }
}

export default List;
